void update_player()
{

  player1.sprite_prev = player1.sprite[player1.sprite_num_prev];
	player1.x_prev = player1.x;
	player1.y_prev = player1.y;

  if (player1.timer_eat_ghosts > 0)
  {
    player1.timer_eat_ghosts = player1.timer_eat_ghosts - 1;
  }

  // move player
  if (player1.dy == 1)
  {
    player1.sprite[0] = pac_000;
    player1.sprite[1] = pac_HOD;
    player1.sprite[2] = pac_OD;
  }
  else if (player1.dy == -1)
  {
    player1.sprite[0] = pac_000;
    player1.sprite[1] = pac_HOU;
    player1.sprite[2] = pac_OU;
  }
  else if (player1.dx == 1)
  {
    player1.sprite[0] = pac_000;
    player1.sprite[1] = pac_001;
    player1.sprite[2] = pac_002;
  }
  else if (player1.dx == -1)
  {
    player1.sprite[0] = pac_000;
    player1.sprite[1] = pac_003;
    player1.sprite[2] = pac_004;
  }

  player1.x_prev = player1.x;
  player1.y_prev = player1.y;

  player1.x += player1.dx;
  player1.y += player1.dy;

  if (player1.x == 98)
  {
    player1.x = MAP_WIDTH - 1;
  }
  else if (player1.x == MAP_WIDTH)
  {
    player1.x = 99;
  }
}

void draw_player()
{

  // DRAW (at new position)
  sprite_draw(player1.sprite[player1.sprite_num], player1.x, player1.y, player1.width, player1.width);

  if (player1.dx != 0 || player1.dy != 0)
  {
    player1.sprite_num_prev = player1.sprite_num;
    player1.sprite_num = (player1.sprite_num + 1) % 3;
  }
}

