void draw_dot(int x, int y){
  for (int sxi = 0; sxi < 4; sxi++)
  {
    for (int syi = 0; syi < 4; syi++)
    {
      int xi = x + sxi;
      int yi = y + syi;
      if (dot[syi * 4 + sxi] != 0x0000)
      {
        dot[syi * 4 + sxi] = 0xfcf8;
      }
      plot_pixel(xi, yi, dot[syi * 4 + sxi]);
    }
  }
}

void redraw_dots(){
  for(int x = 0; x < 320; x++){
      for(int y = 0; y < 240; y++){
          if(dotPos[y * 320 + x] == 0xffff){
              draw_dot(x,y);
          }
          else if (dotPos[y * 320 + x] == 0x67e1)
          {
            sprite_draw(cherry, x, y, 15, 15);
          }
      }
  }
}



void video_text(int x, int y, char * text_ptr) {
	int offset;
	volatile char * character_buffer =(char *)FPGA_CHAR_BASE; // video character buffer
	offset = (y << 7) + x;
	
	while (*(text_ptr)) {
		*(character_buffer + offset) =
		*(text_ptr); // write to the character buffer
		++text_ptr;
		++offset;
  }
}



void final_score(int tempScor){
    int startX = 170;
    do{
        int d = tempScor % 10;
        tempScor = tempScor / 10;
        draw_final_score(startX, 160, dif_scor[d]);
        startX -= 9;
		//printf("diget %d", d);
		waitasec(4);
    } while (tempScor != 0);
  //printf("\n");

}


void draw_final_score(int x, int y,unsigned short dif_scor[]){
  for (int sxi = 0; sxi < 9; sxi++){
    for (int syi = 0; syi < 9; syi++) {
      int xi = x + sxi;
      int yi = y + syi;
		if(dif_scor[syi * 9 + sxi] == 0xfdbf){
      plot_pixel(xi, yi, dif_scor[syi * 9 + sxi]);
    }
    }
  }
}


